INSERT Pokebox.ItemOwned(UserID, ItemID)
SELECT U.UserID, I.ItemID
FROM SourceCTE S
    INNER JOIN Pokebox.[User] U ON U.Username = S.Username
    INNER JOIN Pokebox.Item I ON I.ItemName = S.ItemName;

