INSERT Pokebox.PokeOwned(UserID, PokemonID, [Name], Gender, [Level])
SELECT U.UserID, P.PokemonID, S.Name, S.Gender, S.[Level]
FROM SourceCTE S
    INNER JOIN Pokebox.[User] U ON U.Username = S.Username
    INNER JOIN Pokebox.Pokemon P ON P.PokemonName = S.PokemonName;


