INSERT Pokebox.PokeType(PokemonTypeID, PokemonID)
SELECT PT.PokemonTypeID, P.PokemonID
FROM SourceSCTE S
    INNER JOIN Pokebox.Pokemon P ON P.PokemonName = S.PokemonName
    INNER JOIN Pokebox.PokemonType PT ON PT.PokemonTypeName = S.PokemonTypeName 

